def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""
    result = []
    words = input1.split()
    for word in words:
        parts = word.split('-')
        transformed_parts = [parts[0]] + [part.capitalize() for part in parts[1:]]
        result.append(''.join(transformed_parts))
    return ' '.join(result)
